import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";

const Signup = () => {
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    username: "",
    email: "",
    password: "",
    experience: "",
    skills: "",
    interest_area: "",
    custom_interest: "",
  });

  const [showCustomInterest, setShowCustomInterest] = useState(false);

  const interestOptions = [
    "AI/ML",
    "Web Development",
    "Cybersecurity",
    "Data Science",
    "Software Engineering",
    "Cloud Computing",
    "Blockchain",
    "Others",
  ];

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
    if (e.target.name === "interest_area" && e.target.value === "Others") {
      setShowCustomInterest(true);
    } else if (e.target.name === "interest_area") {
      setShowCustomInterest(false);
    }
  };

  const handleSignup = async (e) => {
    e.preventDefault();
    const finalInterest =
      formData.interest_area === "Others"
        ? formData.custom_interest
        : formData.interest_area;

    const response = await fetch("http://localhost:8000/auth", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({
        username: formData.username,
        email: formData.email,
        password: formData.password,
        experience: formData.experience,
        skills: formData.skills,
        interest_area: finalInterest,
      }),
    });

    if (response.ok) {
      navigate("/");
    } else {
      alert("Signup failed!");
    }
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-gradient-to-r from-blue-500 to-purple-600">
      <div className="bg-white p-8 rounded-lg shadow-lg max-w-md w-full">
        <h2 className="text-3xl font-bold text-center text-gray-800">Sign Up</h2>
        <form className="mt-6" onSubmit={handleSignup}>
          <label className="block mb-2 text-gray-700">Full Name</label>
          <input
            type="text"
            name="username"
            value={formData.username}
            onChange={handleChange}
            className="w-full p-3 rounded-lg border border-gray-300 focus:ring-2 focus:ring-blue-500"
            required
          />

          <label className="block mt-4 mb-2 text-gray-700">Email</label>
          <input
            type="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            className="w-full p-3 rounded-lg border border-gray-300 focus:ring-2 focus:ring-blue-500"
            required
          />

          <label className="block mt-4 mb-2 text-gray-700">Password</label>
          <input
            type="password"
            name="password"
            value={formData.password}
            onChange={handleChange}
            className="w-full p-3 rounded-lg border border-gray-300 focus:ring-2 focus:ring-blue-500"
            required
          />

          <label className="block mt-4 mb-2 text-gray-700">Experience</label>
          <input
            type="text"
            name="experience"
            value={formData.experience}
            onChange={handleChange}
            className="w-full p-3 rounded-lg border border-gray-300 focus:ring-2 focus:ring-blue-500"
            required
          />

          <label className="block mt-4 mb-2 text-gray-700">Skills</label>
          <input
            type="text"
            name="skills"
            value={formData.skills}
            onChange={handleChange}
            className="w-full p-3 rounded-lg border border-gray-300 focus:ring-2 focus:ring-blue-500"
            required
          />

          <label className="block mt-4 mb-2 text-gray-700">Area of Interest</label>
          <select
            name="interest_area"
            value={formData.interest_area}
            onChange={handleChange}
            className="w-full p-3 rounded-lg border border-gray-300 focus:ring-2 focus:ring-blue-500"
            required
          >
            <option value="">Select Interest</option>
            {interestOptions.map((option, index) => (
              <option key={index} value={option}>
                {option}
              </option>
            ))}
          </select>

          {showCustomInterest && (
            <div className="mt-4">
              <label className="block mb-2 text-gray-700">Specify Your Interest</label>
              <input
                type="text"
                name="custom_interest"
                value={formData.custom_interest}
                onChange={handleChange}
                className="w-full p-3 rounded-lg border border-gray-300 focus:ring-2 focus:ring-blue-500"
                required
              />
            </div>
          )}

          <button
            type="submit"
            className="w-full mt-6 bg-blue-600 hover:bg-blue-700 text-white py-3 rounded-lg font-bold transition"
          >
            Create Account
          </button>
        </form>
        <p className="mt-4 text-center text-gray-600">
          Already have an account?{" "}
          <Link to="/" className="text-blue-500 hover:underline">
            Login
          </Link>
        </p>
      </div>
    </div>
  );
};

export default Signup;
